pub enum Token<'input> {

    /// `=`
    Eq,

    /// `>`
    Gt,

    /// `<`
    Lt,

    /// `<=`
    LtEq,

    /// `>=`
    GtEq,

    /// '^`
    Caret,

    /// '~`
    Tilde,

    /// '*`
    Star,

    /// `.`
    Dot,

    /// `,`
    Comma,

    /// `-`
    Hyphen,

    /// `+`
    Plus,

    /// '||'
    Or,

    /// any number of whitespace (`\t\r\n `) and its span.
    Whitespace(usize, usize),

    /// Numeric component, like `0` or `42`.
    Numeric(u64),

    /// Alphanumeric component, like `alpha1` or `79deadbe`.
    AlphaNumeric(&'input str),
}

pub enum Error {

    /// Unexpected character.
    UnexpectedChar(char),
}

pub enum Error<'input> {

    /// Needed more tokens for parsing, but none are available.
    UnexpectedEnd,

    /// Unexpected token.
    UnexpectedToken(Token),

    /// An error occurred in the lexer.
    Lexer(lexer::Error),

    /// More input available.
    MoreInput(Vec<Token>),

    /// Encountered empty predicate in a set of predicates.
    EmptyPredicate,

    /// Encountered an empty range.
    EmptyRange,
}

pub enum Identifier {

    /// An identifier that's solely numbers.
    Numeric(u64),

    /// An identifier with letters and numbers.
    AlphaNumeric(String),
}
